-- SEQUENCE: Tu dong tang index ~ IDENTITY ben BIKEStores SMSS
CREATE SEQUENCE AUTO_INCREMENT_idCATEGORIES
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idCATEGORIES

CREATE TABLE categories (
	category_id NUMBER DEFAULT AUTO_INCREMENT_idCATEGORIES.nextval,
	category_name VARCHAR (255) NOT NULL,
    PRIMARY KEY(category_id)
);
SELECT * FROM categories
DROP TABLE categories;

CREATE SEQUENCE AUTO_INCREMENT_idBRANDS
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idBRANDS

CREATE TABLE brands (
	brand_id NUMBER DEFAULT AUTO_INCREMENT_idBRANDS.nextval,
	brand_name VARCHAR (255) NOT NULL,
    PRIMARY KEY (brand_id)
);
SELECT * FROM brands
DROP TABLE brands

CREATE SEQUENCE AUTO_INCREMENT_idPRODUCTS
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idPRODUCTS

CREATE TABLE products (
	product_id NUMBER DEFAULT AUTO_INCREMENT_idPRODUCTS.nextval,
	product_name VARCHAR (255) NOT NULL,
	brand_id NUMBER NOT NULL,
	category_id NUMBER NOT NULL,
	model_year NUMBER NOT NULL,
	list_price FLOAT NOT NULL,
    PRIMARY KEY (product_id),
	FOREIGN KEY (category_id) REFERENCES categories (category_id),
	FOREIGN KEY (brand_id) REFERENCES brands (brand_id)
--	FOREIGN KEY (category_id) REFERENCES categories (category_id) ON DELETE CASCADE ON UPDATE CASCADE,
--	FOREIGN KEY (brand_id) REFERENCES brands (brand_id) ON DELETE CASCADE ON UPDATE CASCADE
-- CASCADE: Tu dong cap nhat du lieu, can thiet thi tim hieu them -> cho vao 
);
SELECT * FROM products
DROP TABLE products

CREATE SEQUENCE AUTO_INCREMENT_idCUSTOMERS
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idCUSTOMERS

CREATE TABLE customers (
	customer_id NUMBER DEFAULT AUTO_INCREMENT_idCUSTOMERS.nextval,
	first_name VARCHAR (255) NOT NULL,
	last_name VARCHAR (255) NOT NULL,
	phone VARCHAR (25),
	email VARCHAR (255) NOT NULL,
	street VARCHAR (255),
	city VARCHAR (50),
	country VARCHAR (25),
	zip_code VARCHAR (5),
    PRIMARY KEY (customer_id)
);
SELECT * FROM customers
DROP TABLE customers

