CREATE SEQUENCE AUTO_INCREMENT_idSTORES
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idSTORES

CREATE TABLE stores (
	store_id NUMBER DEFAULT AUTO_INCREMENT_idSTORES.nextval,
	store_name VARCHAR (255) NOT NULL,
	phone VARCHAR (25),
	email VARCHAR (255),
	street VARCHAR (255),
	city VARCHAR (255),
	country VARCHAR (10),
	zip_code VARCHAR (5),
    PRIMARY KEY (store_id)
);
SELECT * FROM stores
DROP TABLE stores

CREATE SEQUENCE AUTO_INCREMENT_idSTAFFS
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idSTAFFS

CREATE TABLE staffs (
	staff_id NUMBER DEFAULT AUTO_INCREMENT_idSTAFFS.nextval,
	first_name VARCHAR (50) NOT NULL,
	last_name VARCHAR (50) NOT NULL,
	email VARCHAR (255) NOT NULL CONSTRAINT uniq_email UNIQUE,
	phone VARCHAR (25),
	active NUMBER NOT NULL,
	store_id NUMBER NOT NULL,
	manager_id NUMBER,
    PRIMARY KEY (staff_id),
	FOREIGN KEY (store_id) REFERENCES stores (store_id),
	FOREIGN KEY (manager_id) REFERENCES staffs (staff_id)
    -- FOREIGN KEY (store_id) REFERENCES stores (store_id) ON DELETE CASCADE ON UPDATE CASCADE,
	-- FOREIGN KEY (manager_id) REFERENCES staffs (staff_id) ON DELETE NO ACTION ON UPDATE NO ACTION
);
SELECT * FROM staffs
DROP TABLE staffs

CREATE SEQUENCE AUTO_INCREMENT_idORDERS
START WITH 1
INCREMENT BY 1;
DROP SEQUENCE AUTO_INCREMENT_idORDERS

CREATE TABLE orders (
	order_id NUMBER DEFAULT AUTO_INCREMENT_idORDERS.nextval,
	customer_id NUMBER,
	order_status NUMBER NOT NULL,
	-- Order status: 1 = Pending; 2 = Processing; 3 = Rejected; 4 = Completed
	order_date DATE NOT NULL,
	required_date DATE NOT NULL,
	shipped_date DATE,
	store_id NUMBER NOT NULL,
	staff_id NUMBER NOT NULL,
    PRIMARY KEY (order_id),
    -- 	FOREIGN KEY (customer_id) REFERENCES customers (customer_id) ON DELETE CASCADE ON UPDATE CASCADE,
	-- FOREIGN KEY (store_id) REFERENCES stores (store_id) ON DELETE CASCADE ON UPDATE CASCADE,
	-- FOREIGN KEY (staff_id) REFERENCES staffs (staff_id) ON DELETE NO ACTION ON UPDATE NO ACTION
	FOREIGN KEY (customer_id) REFERENCES customers (customer_id),
	FOREIGN KEY (store_id) REFERENCES stores (store_id),
	FOREIGN KEY (staff_id) REFERENCES staffs (staff_id)
);
SELECT * FROM orders
DROP TABLE orders;

CREATE TABLE order_items (
	order_id NUMBER,
	item_id NUMBER,
	product_id NUMBER NOT NULL,
	quantity NUMBER NOT NULL,
	list_price FLOAT NOT NULL,
	discount FLOAT NOT NULL,
    -- discount FLOAT NOT NULL CONSTRAINT DEFAULT 0, - Trong Oracle khong co rang buoc Default -> Insert them 0
	PRIMARY KEY (order_id, item_id),
	--FOREIGN KEY (order_id) REFERENCES orders (order_id) ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (order_id) REFERENCES orders (order_id),
	--FOREIGN KEY (product_id) REFERENCES products (product_id) ON DELETE CASCADE ON UPDATE CASCADE
    FOREIGN KEY (product_id) REFERENCES products (product_id)
);
ALTER TABLE order_items MODIFY discount NUMBER DEFAULT 0;
SELECT * FROM order_items
DROP TABLE order_items;

CREATE TABLE stocks (
	store_id NUMBER,
	product_id NUMBER,
	quantity NUMBER,
	PRIMARY KEY (store_id, product_id),
	--FOREIGN KEY (store_id) REFERENCES stores (store_id) ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (store_id) REFERENCES stores (store_id),
    --FOREIGN KEY (product_id) REFERENCES products (product_id) ON DELETE CASCADE ON UPDATE CASCADE
    FOREIGN KEY (product_id) REFERENCES products (product_id)
);
SELECT * FROM stocks
DROP TABLE stocks

